import React, {useEffect, useState} from 'react';
import './Login.css';
import Navbar from '../Components/Navbar';

import {
  Row,
  Col,
} from 'react-bootstrap';

import {
  Redirect,
  useParams,
} from "react-router-dom";

function Docs(props) {

  const allMenuItems = [
    { title: 'Contact us' , route: 'contact-link' },
    { title: 'What is modo' , route: 'what-is-modo' },
    {title: 'How to use it' , route: 'how-to-use-it' },
  ];

  return (
    <>
    <Navbar menuItems={allMenuItems}  />

      <Row style={{marginTop: '100px'}}>
        <Col lg={2} className="d-flex">
          <div className="m-auto flex-row" >
            <p className="titre-menu-docs" >Basics</p>
            <p className="sous-titre-menu-docs" >Overview</p>
          </div>
        </Col>
        <Col lg={10}></Col>
      </Row>
    </>
  );
}

export default Docs;
